import React, { useState } from 'react';

export default function SignUp() {
  const [parentName, setParentName] = useState('');
  const [parentLastname, setParentLastname] = useState('');
  const [parentPhone, setParentPhone] = useState('');
  const [parentEmail, setParentEmail] = useState('');
  const [kids, setKids] = useState([{ name: '', lastname: '', birthdate: '' }]);
  const [numKids, setNumKids] = useState(1);

  const handleChange = (event, index) => {
    const { name, value } = event.target;
    const [property, childIndex] = name.split('-'); // Splitting name to get property and index
    const newKids = [...kids];
    newKids[index][property] = value; // Accessing child index and property
    setKids(newKids);
  };

  const handleAddChild = () => {
    setKids([...kids, { name: '', lastname: '', birthdate: '' }]);
    setNumKids(numKids + 1);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    const enfants = [];
    for (let i = 0; i < kids.length; i++) {
      enfants.push({
        nomEnfant: kids[i]['lastname'],
        prenomEnfant: kids[i]['name'],
        dateNaissance: new Date(kids[i]['birthdate']),
      });
    }
    const formData = {
      prenomParent: parentName,
      nomParent: parentLastname,
      tel: parentPhone,
      mail: parentEmail,
      enfants: enfants,
    };
    // Make a POST request to the server
    fetch('http://localhost:8080/addEnfantPreinscrit', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(formData),
    })
      .then((response) => {
        if (response.ok) {
          // Handle successful response
          console.log('Form submitted successfully');
          // Clear form fields
          setParentName('');
          setParentLastname('');
          setParentPhone('');
          setParentEmail('');
          setKids([{ name: '', lastname: '', birthdate: '' }]);
          setNumKids(1);
          // Display success message to user
          alert('Form submitted successfully!');
        } else {
          // Handle error response
          console.error('Error submitting form');
          // Display error message to user
          alert('Error submitting form. Please try again.');
        }
      })
      .catch((error) => {
        // Handle network error
        console.error('Network error:', error);
        // Display error message to user
        alert('Network error. Please try again later.');
      });
  };

  return (
    <div>
      <h1 className='sign-up'>pré-inscrie maintenant!</h1>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="parent-name">Prénom du parent:</label>
          <input
            type="text"
            id="parent-name"
            name="parentName"
            value={parentName}
            onChange={(event) => setParentName(event.target.value)}
          />
        </div>
        <div>
          <label htmlFor="parent-lastname">Nom du parent:</label>
          <input
            type="text"
            id="parent-lastname"
            name="parentLastname"
            value={parentLastname}
            onChange={(event) => setParentLastname(event.target.value)}
          />
        </div>
        <div>
          <label htmlFor="parent-phone">Numéro de téléphone:</label>
          <input
            type="tel"
            id="parent-phone"
            name="parentPhone"
            value={parentPhone}
            onChange={(event) => setParentPhone(event.target.value)}
          />
        </div>
        <div>
          <label htmlFor="parent-email">Votre email:</label>
          <input
            type="email"
            id="parent-email"
            name="parentEmail"
            value={parentEmail}
            onChange={(event) => setParentEmail(event.target.value)}
          />
        </div>
        {numKids > 0 && (
          <div>
            <label htmlFor={`child-name-0`}>Prénom de l'enfant:</label>
            <input
              type="text"
              id={`child-name-0`}
              name={`name-0`}
              value={kids[0].name}
              onChange={(event) => handleChange(event, 0)}
            />
            <label htmlFor={`child-lastname-0`}>Nom de l'enfant:</label>
            <input
              type="text"
              id={`child-lastname-0`}
              name={`lastname-0`}
              value={kids[0].lastname || ''}
              onChange={(event) => handleChange(event, 0)}
            />
            <label htmlFor={`child-birthdate-0`}>Date de naissance de l'enfant:</label>
            <input
              type="date"
              id={`child-birthdate-0`}
              name={`birthdate-0`}
              value={kids[0].birthdate || ''}
              onChange={(event) => handleChange(event, 0)}
            />
          </div>
        )}
             {numKids > 1 && (
  <div>
    <label htmlFor={`child-name-1`}>Prénom de l'enfant:</label>
    <input
      type="text"
      id={`child-name-1`}
      name={`name-1`}
      value={kids[1].name}
      onChange={(event) => handleChange(event, 1)}
    />
    <label htmlFor={`child-lastname-1`}>Nom de l'enfant:</label>
    <input
      type="text"
      id={`child-lastname-1`}
      name={`lastname-1`}
      value={kids[1].lastname || ''}
      onChange={(event) => handleChange(event, 1)}
    />
    <label htmlFor={`child-birthdate-1`}>Date de naissance de l'enfant:</label>
    <input
      type="date"
      id={`child-birthdate-1`}
      name={`birthdate-1`}
      value={kids[1].birthdate || ''}
      onChange={(event) => handleChange(event, 1)}
    />
  </div>
)}
{numKids > 2 && (
  <div>
    <label htmlFor={`child-name-2`}>Prénom de l'enfant:</label>
    <input
      type="text"
      id={`child-name-2`}
      name={`name-2`}
      value={kids[2].name}
      onChange={(event) => handleChange(event, 2)}
    />
    <label htmlFor={`child-lastname-2`}>Nom de l'enfant:</label>
    <input
      type="text"
      id={`child-lastname-2`}
      name={`lastname-2`}
      value={kids[2].lastname || ''}
      onChange={(event) => handleChange(event, 2)}
    />
    <label htmlFor={`child-birthdate-2`}>Date de naissance de l'enfant:</label>
    <input
      type="date"
      id={`child-birthdate-2`}
      name={`birthdate-2`}
      value={kids[2].birthdate || ''}
      onChange={(event) => handleChange(event, 2)}
    />
  </div>
)}
{numKids > 3 && (
  <div>
    <label htmlFor={`child-name-3`}>Prénom de l'enfant:</label>
    <input
      type="text"
      id={`child-name-3`}
      name={`name-3`}
      value={kids[3].name}
      onChange={(event) => handleChange(event, 3)}
    />
    <label htmlFor={`child-lastname-3`}>Nom de l'enfant:</label>
    <input
      type="text"
      id={`child-lastname-3`}
      name={`lastname-3`}
      value={kids[3].lastname || ''}
      onChange={(event) => handleChange(event, 3)}
    />
    <label htmlFor={`child-birthdate-3`}>Date de naissance de l'enfant:</label>
    <input
      type="date"
